import './Dashboard.css';
import './Generic.css';
import RateReviewIcon from '@mui/icons-material/RateReview';
import HowToRegIcon from '@mui/icons-material/HowToReg';
import LoginIcon from '@mui/icons-material/Login';


function Dashboard() {
  return (
    <div className="Dashboard">
      <div className="top-bar">
        <div className='NavDiv'>
        <p> LuxorMotos </p>
        </div>

        <button className="reviewButton">
          <div className='tooltip'>
            <RateReviewIcon color='action' sx={{fontSize: 30}} />
          <span className="tooltiptext">Leave a Review!</span>
          </div>

        </button>

        <button className="loginButton">
        <div className='tooltip'>
            <LoginIcon color='action' sx={{fontSize: 30}} />
            <span className='tooltiptext'>Log In</span>
          </div>
        </button>

        <button className="signinButton">
          <div className='tooltip'>
            <HowToRegIcon color='action' sx={{fontSize: 30}} />
            <span className='tooltiptext'>Sign In</span>
          </div>

        </button>

      </div>
    </div>
  );
}

export default Dashboard;
